import React from 'react';

class MyComponent extends React.Component{
    
    render (){
        let name = 'Hau'
        return (
       
            <div>
            {
                console.log('My name is:', name)
            }
            hello my Component  { name } 
            </div>
        )
    }
}

export default MyComponent;
